import React from 'react';
import PropTypes from 'prop-types';
import { withStyles } from '@material-ui/core/styles';
// Components
import DialogueBox from './DialogueBox';
// Material Components
import List from '@material-ui/core/List';
import ListItem from '@material-ui/core/ListItem';
import ListItemText from '@material-ui/core/ListItemText';
import Divider from '@material-ui/core/Divider';
import Avatar from '@material-ui/core/Avatar';
import Tooltip from '@material-ui/core/Tooltip';
import Card from '@material-ui/core/Card';
import CardContent from '@material-ui/core/CardContent';
import CardMedia from '@material-ui/core/CardMedia';
import CardActions from '@material-ui/core/CardActions';
import Typography from '@material-ui/core/Typography';
import NewReleasesIcon from '@material-ui/icons/NewReleases';
import SearchIcon from '@material-ui/icons/Search';
import MonetizationOnIcon from '@material-ui/icons/MonetizationOn';
import WarningIcon from '@material-ui/icons/Warning';
import InfoIcon from '@material-ui/icons/Info';

const styles = theme => ({
  card: {
    maxWidth: 345,
    minHeight: 415,
  },
  media: {
    // ⚠️ object-fit is not supported by IE 11.
    objectFit: 'cover',
  },
  listText: {
    padding: `0 16px`,
  },
  typoIndent: {
    display: 'block',
    paddingLeft: '72px',
  },
  typoAnno: {
    display: 'block',
  },
  typoAnnoIcon: {
    verticalAlign: 'middle',
    marginRight: '5px',
  }
});

function ItemCard(props) {
  const { classes, data } = props;
  const baseUrl = `/assets/images/`;

const dialogueContent = (data, classes) => {
  return (
    <Typography variant="body2">
      {data.description}
      {data.procurement && ( 
        <List className={classes.root}>
          <ListItem>
            <Tooltip title={data.procurement} placement="left">
              <Avatar>
                {data.procurement === 'Rewarded' && (<NewReleasesIcon />)}
                {data.procurement === 'Discovered' && (<SearchIcon />)}
                {data.procurement === 'Purchased' && (<MonetizationOnIcon />)}
              </Avatar>
            </Tooltip>
            <ListItemText className={classes.listText} primary="Find" secondary={data.location} />
          </ListItem>
        </List>
      )}
      {data.find && (
        <Typography variant="body2">
          <Divider /> 
          {data.find}
        </Typography>
        )
      }
      {data.requirement && (
          <Typography className={classes.typoAnno} align="left" variant="caption" gutterBottom={false} color="textSecondary">
            <WarningIcon className={classes.typoAnnoIcon} /> 
            {data.requirement}
          </Typography>
        )
      }
      {data.note && (
          <Typography className={classes.typoAnno} align="left" variant="caption" gutterBottom={false} color="textSecondary">
            <InfoIcon className={classes.typoAnnoIcon} /> 
            {data.note}
          </Typography>
        )
      }
      {data.utility && (
          <Typography className={classes.typoAnno} align="left" variant="caption" gutterBottom={false} color="textSecondary">
            <InfoIcon className={classes.typoAnnoIcon} /> 
            {data.utility}
          </Typography>
        )
      }
      {data.effect && (
          <Typography className={classes.typoAnno} align="left" variant="caption" gutterBottom={false} color="textSecondary">
            <InfoIcon className={classes.typoAnnoIcon} /> 
            {data.effect}
          </Typography>
        )
      }
    </Typography>
  )
}

  return (
    <Card className={classes.card}>
      <CardMedia
        component="img"
        className={classes.media}
        height="auto"
        image={data.img && ( baseUrl+data.img )}
        title={data.title}
        alt-title={data.title}
      />
      <CardContent>
        <Typography variant="headline" component="h3">
          {data.title}
        </Typography>
        <Divider />
        <Typography gutterBottom variant="body2" component="h6">
          {data.location}
        </Typography>
      </CardContent>
      <CardActions>
        <DialogueBox data={data}>
          <Typography gutterBottom>
            {dialogueContent(data, classes)}
          </Typography>
        </DialogueBox>
      </CardActions>
    </Card>
  );
}

ItemCard.propTypes = {
  classes: PropTypes.object.isRequired,
};

export default withStyles(styles)(ItemCard);
